    width: '18px',
    height: '18px',
    paddingTop:'7px'
  },
  icon: {
    paddingLeft: '8px',
    paddingTop:'7px'

  },
  avatar:{
  height:'36px',
  width:'36px',
  paddingBottom:'3px',
  paddingLeft: '7px',

  },
  text: {
    fontSize: '18px',
    lineHeight: '20px',
    width: '76px',
    height: '20px',
    fontFamily: 'Poppins',
    fontWeight: 500,
    paddingTop:'7px'
  },
};

export const Header = (props: headerProps) => {


  return (
    <Grid
      container
      direction="row"
      spacing={1}
      style={{
        border: '2px solid #D4D2D9',
        width:'1336px',
        height:'55px',        
marginTop:'-16px',
marginLeft:'-16px'

      }}
    >
      <Grid item>
        <Icon imageSrc={Dossier} classname={styles.customSearch}></Icon>
      </Grid>
      <Grid item md={10} sm={4} style={{}}>
        <TypographyComponent
          variant="body1"
          text="DOSSIER"
          color="#4C2CD9"
          classname={cssClasses.text}
        ></TypographyComponent>
      </Grid>
      <Grid item >
        <Icon imageSrc={Help} classname={styles.icon}></Icon>
      </Grid>
      <Grid item >
        <Icon imageSrc={Notification} classname={styles.icon}></Icon>
      </Grid>
      <Grid item >
        <Avatar variant={'circular'} src={User}></Avatar>
      </Grid>
    </Grid>


  )
}
